import { BASE_API_URL } from '../constants';

export async function getKantoPokemons() {
    try {
        const response = await fetch('https://pokeapi.co/api/v2/');
        //console.log(response);
        const data = await response.json();
        //console.log(data);
        return data;
    } catch (e){
        console.error(e)
    }
}
